import Icon from "../../components/Icon/Icon";
import { GlobalThemes } from "../../ThemeManager";
import "./SpookyTheme.scss";
const SpookyTheme = ({}: {}) => {
  return (
    <div className="spookyContent">
      <div className="background">
        <Icon icon="HHouse" viewBox="47.115 12.883 422.077 461.451" />
      </div>
      <div className="windowContent">
        <Icon icon="LeftTopWindow" viewBox="0 0 55 95" />
        <div className="flipHorz">
          <Icon icon="LeftTopWindow" viewBox="0 0 55 95" />
        </div>

        <Icon icon="LeftTopWindow" viewBox="0 0 55 95" />

        <Icon icon="LeftTopWindow" viewBox="0 0 55 95" />
      </div>
    </div>
  );
};
export default SpookyTheme;
